import React, { Fragment } from 'react';
import NavBar from '../components/navBar/NavBar';
import './Main.css';

export default class Main extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            scrollHeight: 0,
        }
    }

    componentDidMount() {
        document.querySelector('').addEventListener('scroll', this.handleScroll);
    };

    render() {
        return (
            <Fragment>
                <NavBar />
                <article id="content">
                    <section id="about">
                        <div className="sectionHeader">About</div>
                    </section>
                    <section id="experience">
                        <div className="sectionHeader">Experience</div>
                    </section>
                    <section id="skills">
                        <div className="sectionHeader">Skills</div>
                    </section>
                    <section id="projects">
                        <div className="sectionHeader">Projects</div>
                    </section>
                    <section id="contact">
                        <div className="sectionHeader">Contact</div>
                    </section>
                </article>
            </Fragment>
        );
    }
}
